- input: "TEXT\x1CC00438341\x1CX0\x1C\x1CF3A\x1CThis report has been amended to clarify
    a few points of concern:    1.  A contribution made by the Planned Parenthood
    Action Fund was incorrectly dated; this has been fixed.  As such, the contribution
    does not fall within the pre-primary 48-hour reporting period.    2.  We have
    added an explanation to the in-kind contribution made by DANPAC on July 24, 2010,
    for $2,702.80.  The contribution was not reported within 48 hours due to miscommunication
    between our committees; more details can be found in the memo text on that contribution.
    \   3.  Year-to-date totals on the summary pages have been corrected.    4.  Disbursements
    labeled as 'production' have been edited to further explain their purpose.\n"
