  - name: TEXT4000
    number: '6'
    value: 'This report has been amended to clarify a few points of concern:    1.  A
      contribution made by the Planned Parenthood Action Fund was incorrectly dated;
      this has been fixed.  As such, the contribution does not fall within the pre-primary
      48-hour reporting period.    2.  We have added an explanation to the in-kind
      contribution made by DANPAC on July 24, 2010, for $2,702.80.  The contribution
      was not reported within 48 hours due to miscommunication between our committees;
      more details can be found in the memo text on that contribution.    3.  Year-to-date
      totals on the summary pages have been corrected.    4.  Disbursements labeled
      as ''production'' have been edited to further explain their purpose.

'
- input: "TEXT\x1CC00438341\x1CX1\x1CC18856603\x1CSA11C\x1CThe contribution of $2,702.80
    on July 24, 2010 represents airfare that was provided as an in-kind contribution
    by DANPAC, the leadership PAC of Senator Dan Inouye.  Senator Inouye attended
    a fundraising event for Schauer for Congress, and DANPAC paid for the airfare.
    \ While this contribution was made within the 48-hour reporting period prior to
    the primary election, and exceeded $1,000, it was not reported to the FEC, because
    it was not reported to us in time.    At the time, we did not believe that the
    cost of the airfare would exceed $1,000.  Although the airfare was 'contributed'
    on July 24, 2010, the date of the event, we were not notified of the costs until
    August 9, 2010, well outside the 48-hour window and after the primary election.
    \ Had we known that DANPAC might exceed $1,000 in contributions, we would have
    followed up immediately to ensure compliance.    Our intent was certainly not
    to try to avoid reporting this contribution.  That said, we will take steps in
    the future to ensure that all contributions within a pre-election window are reported
    promptly.\n"
